import React from "react";
import "./Month.css"

export default props => {

    const monthNow = new Date().getMonth();
        return(
                    <button
                        type="button"
                        className="btn btn-primary"
                        autoFocus={props.index===monthNow}
                        onClick={props.monthClick}
                    >
                        {props.month}
                    </button>
        )

}
